import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import SignupForm from './components/Auth/SignupForm';
import LoginForm from './components/Auth/LoginForm';
import ProjectList from './components/ProjectList';  // Import your ProjectList component
import ProjectDetails from './components/ProjectDetails';  // Import your ProjectDetails component

const App = () => {
  return (
    <Router>
      <div className="app">
        <Routes>
          {/* Redirect root to /signup */}
          <Route path="/" element={<Navigate to="/signup" />} />

          {/* Signup and Login routes */}
          <Route path="/signup" element={<SignupForm />} />
          <Route path="/login" element={<LoginForm />} />

          {/* Project List route */}
          <Route path="/projects" element={<ProjectList />} />

          {/* Project Details route, with dynamic projectId */}
          <Route path="/projects/:projectId" element={<ProjectDetails />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
